import React from "react";
import NavBarSearch from "./reusables/NavBarSearch";
import NavBarLogin from "./reusables/NavBarLogin";
import NavbarMenu from "./reusables/NavbarMenu";

const Navbar = () => {
  return (
    <>
      <NavBarSearch />
      <NavbarMenu />
      <NavBarLogin />
    </>
  );
};

export default Navbar;
